import React from 'react'
import Item from '../JSX/Item'
import Menu from '../../Pages/JSX/Menu'
const RelatedProducts = (props) => {
  return (
    <div>
      <h1>Related Products</h1>
      
      <Menu  category={props.category}/>
    </div>
  )
}

export default RelatedProducts
